export function getColors (): CategorizedColorGrid {
  return cloneDeep(Colors)
}

export function getColor (): Color | void {
  const colors = getColors()
  const fam1 = Object.keys(colors)[0]
  if (colors[fam1]) {
    return colors[fam1][0][0]
  }
}

export function getAllColors (): CategorizedColorById {
  return require('./allcolors.json')
}

export function getlpColors () {
  let lp = {}
  lp.colors = [allColors['1544'], allColors['2446']]
  lp.activeColor = [allColors['1544']]
  return lp
}

export function getlpColorsByCount (count: number = 2) {
  let lp = {}
  // $FlowIgnore
  lp.colors = sampleSize(allColors, count)
  lp.activeColor = [lp.colors[0]]
  return lp
}

